# Split the input string into individual result entries
results_list = results_str.strip().split('\n')

# Initialize variables to store total Rouge scores and number of valid results
total_rouge_1_f = 0
total_rouge_2_f = 0
total_rouge_l_f = 0
num_valid_results = 0

# Iterate over each result entry
for result in results_list:
    # Check if the line contains "Skipped"
    if "Skipped" in result:
        continue
    
    # Extract Rouge scores dictionary
    rouge_scores_str = result.split("=>")[1].strip()
    rouge_scores_dict = ast.literal_eval(rouge_scores_str)
    
    # Extracting Rouge scores
    rouge_1_f = rouge_scores_dict['rouge-1']['f']
    rouge_2_f = rouge_scores_dict['rouge-2']['f']
    rouge_l_f = rouge_scores_dict['rouge-l']['f']
    
    # Add Rouge scores to totals
    total_rouge_1_f += rouge_1_f
    total_rouge_2_f += rouge_2_f
    total_rouge_l_f += rouge_l_f
    num_valid_results += 1

# Calculate average Rouge scores
average_rouge_1_f = total_rouge_1_f / num_valid_results
average_rouge_2_f = total_rouge_2_f / num_valid_results
average_rouge_l_f = total_rouge_l_f / num_valid_results

# Display average Rouge scores
print("Average Rouge-1 F1:", average_rouge_1_f)
print("Average Rouge-2 F1:", average_rouge_2_f)
print("Average Rouge-L F1:", average_rouge_l_f)
